class Location extends Component {
    delete=()=>{
        console.log(this.props.longitude)
    }
    render() {
        return (
            <div>
                <h3>{this.props.latitude}{this.props.longitude}</h3>
                <button onSubmit={this.delete()}>
                Delete
                </button>
            </div>
        )
    }
}
